         y="15.996"
         id="tspan126">Ordene findes i rammen nederst på siden. </tspan><tspan

       id="text174"><tspan
         x="0 6.2184 11.2236 15.6276 18.663601 24.8904 30.3624 33.398399 39.448799 43.984798 47.1768 53.728802 58.768799 61.804798 70.818001 76.050003 82.601997 86.862 91.865997 98.417999 101.454 107.6688 113.838 118.242 121.278 124.47 127.506 132.5808 136.2888 139.3248 145.6512 152.1312 156.3912 159.4272 162.6192 165.6552 172.9776 179.1456 183.52679 187.7868 193.9908 198.39481 201.4308 211.3188 216.3828 222.7188 225.75481 232.056 237.06 241.3212 246.36121 250.6212 253.6572 257.24881 263.45279 266.4888 272.66879 278.8728 283.3584 289.9104 292.4328 295.46881 304.2276 309.26761 312.30359 318.69958 323.93161 328.3356 331.37161 341.25961 346.49161 353.04361 358.49161 363.53159 366.5676 371.63159 374.65561 379.69559 385.57559 389.35321 393.88919 397.08121 401.34119 407.0076 412.04761 415.08359 424.97159 430.20361 434.46359 440.3436 443.53561 450.08759 455.0928 459.4968 462.53281 468.75961 474.2316 477.26761 482.4996 488.80081 495.13681 500.3688"
         y="0"
         id="tspan144">Per og Trine Hansen bor i et hus i Korsør med deres to børn. De har mange elektriske maskiner og appa-</tspan><tspan
         x="0 4.4976001 9.7296 13.332 18.3372 22.069201 24.5928 27.628799 31.8888 37.1208 40.156799 43.348801 46.3848 52.686001 57.726002 60.762001 65.022003 68.213997 74.550003 78.809998 82.412399 87.4524 90.488403 96.824402 102.0564 106.4604 109.4964 114.7284 119.1324 122.1684 128.56441 133.7964 138.20039 141.2364 144.7764 150.00841 159.89639 163.08839 166.1124 169.3044 174.3084 180.8604 183.89639 190.2924 195.5244 199.06441 202.7724 205.8084 210.8136 217.3656 220.4016 230.2896 235.3764 240.8244 245.8992 249.60719 252.6432 258.64319 264.64319 270.64319 276.64319 282.64319 288.64319 294.64319 300.64319 306.64319 312.64319 318.64319 324.64319 330.64319 336.64319 342.64319 348.64319 351.6792 356.74319 359.76721 364.02719 369.11401 374.71799 381.26999 384.46201 391.01401 396.62881"
         y="27"
         id="tspan146">rater, så i de sidste par år har familien haft en meget ________________ elregning.</tspan><tspan
         x="0 10.3824 15.3864 21.9384 24.9744 31.444799 37.924801 40.9608 46.6236 49.815601 52.8396 55.875599 62.1768 67.216797 70.2528 76.554001 80.958 87.162003 92.4552 97.495201 100.5312 105.7632 109.4712 112.5072 116.7672 123.1032 128.33521 132.5952 137.63519 140.6712 147.0072 152.2392 155.27521 161.5752 166.5804 173.1324 176.1684 182.42281 187.96561 192.2256 197.26559 200.30161 205.3644 208.3884 210.9108 213.94679 222.7068 227.7468 230.78281 236.4456 239.6376 242.66161 245.6976 252.2496 257.2536 267.1416 270.16559 273.3576 278.82959 281.8656 287.8656 293.8656 299.8656 305.8656 311.8656 317.8656 323.8656 329.8656 335.8656 341.8656 347.8656 353.8656 359.8656 365.8656 371.8656 377.8656 380.90161 387.04681 391.53241 398.01239 403.46039 408.5004 411.53641 417.83759 422.8428 427.10281 432.14279 436.4028 439.43881 445.83359 450.83759 457.38959 462.83881 467.87881 470.91479 477.25079 482.48279 485.5188 492.0708 498.29761 503.74561 508.82159 512.5296"
         y="74.003998"
         id="tspan148">Men nu vil de prøve at spare på den dyre el. De vil nemlig ________________ bruge deres penge på noget </tspan><tspan
         x="0 5.2319999 11.784 18.084 23.16 26.868 29.903999 34.908001 41.459999 47.796001 50.832001 55.896 58.919998 61.442402 64.478401 70.540802 75.772797 85.660797 88.852798 91.876801 95.068802 100.0728 106.6248 109.6608 118.6752 123.9072 130.4592 134.71919 139.72321 146.27521 149.3112 155.7072 160.93919 165.3432 168.3792 174.6792 179.6844 184.1472 187.6512 193.8204 198.2244 201.26041 206.73241 209.7924 215.96159 220.5672 224.27521 227.3112 237.1992 242.4312 248.9832 254.4312 259.47119 262.5072 266.25 269.44199 275.99399 281.466 284.50201 288.0072 294.1752 298.57919 301.6152 306.8472 310.55521 313.59119 317.8512 325.69919 329.4072 333.00961 338.04959 341.0856 346.14841 349.17239 352.67761 358.8468 363.39359 369.53879 374.02441 380.50439 385.95361 391.02841 394.73639 397.7724 404.3244 409.38721 415.72321 418.24561 421.28159 430.0416 435.0816 438.11761 444.51361 449.74561 454.1496 457.18561 460.72559 463.60559 468.6456 474.5256 478.78561 481.30679 484.3428 490.22281 496.42679 502.6308 506.33881"
         y="101.004"
         id="tspan150">andet end el. Familien Hansen har derfor gjort mange ting for at sætte elforbruget ned. De har f.eks. købt </tspan><tspan
         x="0 5.0748 8.7827997 11.8188 18.096001 23.6856 27.3936 30.4296 36.309601 42.513599 45.537601 50.577599 54.837601 60.717602 65.9496 71.842796 74.365196 77.401199 83.401199 89.401199 95.401199 101.4012 107.4012 113.4012 119.4012 125.4012 131.4012 137.4012 143.4012 149.4012 155.4012 161.4012 167.4012 173.4012 176.43719 182.7384 187.8132 191.52119 194.55721 200.088 205.32001 215.20799 218.23199 223.272 226.308 229.84801 236.328 242.88 248.328 253.33321 257.59439 262.6572 268.9584 273.99841 277.03439 282.45959 288.69839 295.03439 298.7424 301.77841 308.33041 314.53439 320.4144 322.9368 325.97281 336.354 341.35919 347.91119 350.9472 357.24719 362.32321 366.03119 369.0672 375.21121 379.698 386.17801 391.64999 395.25241 400.29239 403.3284 408.56039 411.58441 415.29239 418.3284 421.83359 428.00281 432.4068 435.44281 445.33081 450.41641 455.8656 460.9404 464.64841 467.68439 472.74841 475.7724 478.2948 481.33081 490.0896 495.16559 498.8736"
         y="128.004"
         id="tspan152">et nyt køleskab, ________________ det gamle fungerede godt nok. Men det brugte alt for meget el. Det </tspan><tspan
         x="0 6.276 11.4972 16.537201 19.5732 25.453199 31.6572 34.681198 39.721199 43.981201 49.861198 55.093201 61.273201 64.309196 70.454399 74.940002 81.419998 86.869202 91.873199 96.277199 99.313202 109.2012 114.288 119.7372 124.812 128.52 131.556 137.556 143.556 149.556 155.556 161.556 167.556 173.556 179.556 185.556 191.556 197.556 203.556 209.556 215.556 221.556 227.556 230.592 235.6548 238.6788 241.2012 244.2372 250.46519 255.93719 258.97321 265.27441 270.34921 274.05719 277.0932 283.30801 288.38281 292.2468 297.4668 303.76801 308.772 312.50519 315.02759 318.0636 323.29559 327.0036 330.03961 336.34079 341.3808 344.41681 349.6488 352.73041 355.75439 360.75961 365.01959 370.08359 376.38361 381.42361 384.45959 390.9288 397.40881 400.44479 404.7048 411.0408 416.2728 420.53281 425.53799 429.94199 432.978 439.37161 444.3768 450.9288 456.3768 461.41681 464.45279 470.78879 476.02081 479.05679 485.358 490.36319 494.6232 499.66321 503.92319"
         y="155.004"
         id="tspan154">nye køleskab bruger meget ________________ el, og det betyder, at de allerede nu sparer penge på deres </tspan><tspan
         x="0 5.0640001 8.0880003 11.592 17.7612 22.308001 28.453199 32.938801 39.4188 45.034801 47.557201 50.593201 56.773201 62.9772 67.381203 70.417198 76.561203 81.047997 87.528 93 96.602402 101.6424 104.6784 110.9784 116.0184 119.0544 125.2824 130.82401 135.084 140.31599 143.35201 147.09599 150.28799 153.996 157.032 163.33321 168.33839 172.5984 177.6384 181.89841 184.9344 190.4292 195.66119 199.9212 205.5876 210.5928 220.4808 225.7128 229.97279 235.8528 239.0448 245.5968 250.6368 253.158 256.194 262.746 267.978 272.38199 275.418 281.71921 286.75919 289.7952 295.7952 301.7952 307.7952 313.7952 319.7952 325.7952 331.7952 337.7952 343.7952 349.7952 355.7952 361.7952 367.7952 373.7952 379.7952 385.7952 388.83121 393.09119 398.97119 405.4512 408.53281 411.55679 416.5968 419.63281 425.12881 430.36081 434.62079 440.28601 445.32599 448.362 453.43799 457.146 460.18201 466.51801 471.75 476.15399 479.19 485.33521 491.81519 497.69519 501.9552 506.96039 511.36441"
         y="182.004"

         y="209.004"
         id="tspan158">eller en enkelt bluse. Men nu ________________ de altid maskinen helt, før de starter den. Tørretumble-</tspan><tspan

         y="236.004"
         id="tspan160">ren bruger de heller ikke så meget, som de gjorde før. De har nemlig sat en tørresnor op ude i haven, så de </tspan><tspan

         y="263.004"
         id="tspan162">kan tørre deres vasketøj udenfor, når det er varmt. Familien sparer også på elektriciteten andre steder. Når </tspan><tspan

         y="290.004"
         id="tspan164">de er færdige med at se tv om aftenen, slukker de ikke bare for fjernsynet med fjernbetjeningen, de slukker </tspan><tspan

         id="tspan168">slukker det på kontakten. Og de ________________ selvfølgelig også at slukke lyset i de værelser, hvor de </tspan><tspan

         id="tspan170">ikke er. Sidste år havde familien Hansen et meget stort elforbrug, så de skulle betale en ekstraregning på </tspan><tspan

       id="text140"><tspan
         x="0 5.9520001 12.252 16.957199 22.1304 28.898399 31.538401 37.754398 44.426399 51.194401 57.734402 60.374401 64.2024 69.096001 74.627998 77.030403 84.760803 90.292801 95.212799 101.826 108.498 113.166 115.806 122.49 128.022 132.81 135.45 140.6232 147.3912 150.0312 154.6992 158.6004 164.8656 169.65359 172.29359 175.7496 182.51759 186.4068 191.58 196.2852 201.49319 206.16119 210.82919 216.0372 218.6196 221.2596 225.9276 232.19279 242.22479 244.86481 251.5488 257.08081 263.84879 266.4888 272.94601 277.88879 284.56079 290.2608 295.43399 300.22198 302.862 309.63 317.646 322.314 326.20319 331.3764 338.14441 340.78439 346.31641 349.6524 352.29239 356.96039 360.41641 367.18439 369.8244 373.6524 378.6312 382.08719 386.14081 389.5968 396.13681 398.77679 405.28079 410.81281 413.63519 416.27521 426.30719 432.60721 436.50839 442.77359 447.46799 452.56799 458.28961 464.49359 467.82959 473.00159 477.1188 479.7012"
         y="0"

    <text

       transform="matrix(1,0,0,-1,99.0863,484.3958)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:12px;font-family:Minion;-inkscape-font-specification:Minion-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text156"><tspan
         x="0 8.7480001 13.98 17.016001 22.728001 28.931999 33.192001 38.197201 44.749199 47.785198 53.869202 60.349201 66.901199 73.237198 76.273201 81.769203 87.001198 91.405197 94.4412 99.445198 105.9972 109.0332 112.0572 115.2492 118.332 121.356 126.396 129.43201 135.76801 140.028 145.0332 151.58521 157.2 159.7224 162.75841 168.25439 173.4864 177.8904 180.92641 187.3224 192.5544 199.1064 203.36639 206.4024 210.6624 214.37041 220.5744 224.9556 229.21561 232.81799 237.858 240.894 247.23 251.634 257.83801 267.72601 270.76199 275.99399 279.702 282.73801 288.61801 294.82199 299.082 304.12201 307.15799 313.49399 318.72601 321.76199 331.64999 337.854 341.4444 347.61359 351.8736 356.87759 362.28839 367.9548 373.01761 376.0416 378.564 381.60001 387.31201 392.54401 395.57999 401.91599 407.14801 410.18399 416.57999 421.81201 428.36401 431.39999 437.556 440.57999 445.70279 451.1868 454.22281 459.98279 465.7428 468.77881 474.0108 477.74399 480.26639"
         y="0"
         id="tspan148">Da Søren Lund var en lille dreng, var hans største drøm at køre på motorcykel. Så da han blev 18 år, </tspan><tspan
         x="0 3.5904 9.8184004 15.2904 18.326401 24.722401 29.954399 36.506401 39.5424 49.430401 55.634399 59.2248 65.393997 69.653999 74.657997 80.068802 85.735199 90.797997 93.821999 99.702003 105.906 110.1672 115.2072 120.8496 127.0176 131.6244 135.3324 138.36839 144.5952 150.0672 153.1032 158.9832 165.18719 171.3912 174.99361 180.0336 183.0696 188.07359 194.6256 197.66161 203.80679 208.2924 214.7724 220.2444 223.95239 226.9884 236.8764 243.0804 246.67081 252.84 257.10001 262.104 267.5148 273.18121 278.24399 281.26801 283.79041 286.82639 295.5864 300.59161 307.14359 310.1796 316.0596 322.26361 326.87039 330.47281 335.51279 338.5488 344.2608 350.46481 354.72479 359.73001 366.28201 369.31799 375.65399 380.88599 383.922 387.11401 390.14999 396.354 400.06201 403.66321 408.70319 411.7392 416.97119 420.70441 423.22681 426.26279 432.49081 437.9628 440.99881 445.25879 450.49081 453.52679 459.1308 462.32281 468.20279"
         y="23.496"
         id="tspan150">tog han motorcykelkørekort og købte en brugt motorcykel. Den kørte Søren på i otte år, og så gik </tspan><tspan
         x="0 6.3011999 11.3052 17.857201 20.8932 24.085199 27.121201 31.381201 35.243999 40.6548 46.534801 52.201199 57.206402 60.9384 63.4608 66.496803 72.496803 78.496803 84.496803 90.496803 96.496803 102.4968 108.4968 114.4968 120.4968 126.4968 132.4968 138.4968 144.4968 150.4968 156.4968 162.4968 165.0192 168.05521 174.0204 180.18961 184.5936 187.62959 191.8896 196.9536 199.86 205.1412 211.31039 221.19839 224.23441 229.9464 236.15041 240.4104 245.4156 251.96761 255.0036 260.88361 267.08759 273.29041 276.89279 281.9328 284.96881 289.974 296.526 299.56201 305.95801 311.02081 314.0448 317.75281 320.78879 327.06479 332.4288 335.46481 341.69281 347.16479 350.20081 360.08881 365.1756 370.6236 375.69839 379.4064 382.44241 388.7688 395.24881 399.8544 403.5972 406.78922 412.2612 415.29721 425.18521 431.38919 434.97961 441.1488 445.40881 450.41281 455.82361 461.48999 466.5528 469.57681 472.09921"
         y="46.992001"
         id="tspan152">den i stykker. ________________. For selvom Søren købte en helt ny og meget hurtig motorcykel, </tspan><tspan
         x="0 6.2147999 11.2908 15.1536 20.3736 26.674801 31.678801 36.082802 39.118801 45.419998 50.425201 56.9772 60.013199 63.5532 69.757202 74.137199 78.397202 81.999603 87.039597 90.0756 96.627602 102.8556 108.3036 113.3784 117.0864 120.1224 126.5184 131.58121 134.60519 138.3132 141.3492 145.60921 153.4572 157.908 160.93201 164.12399 169.59599 173.304 176.34 179.8452 186.0132 190.41721 193.4532 199.8492 205.08121 214.96919 217.49159 220.5276 226.23959 231.4716 234.5076 240.80881 245.81281 252.36481 255.4008 259.6608 263.3688 268.6008 273.00479 276.0408 279.23279 282.2688 287.79959 293.03159 297.52802 302.76001 308.2092 313.2132 319.7652 322.80121 328.09561 333.15839 339.49438 342.5304 346.79041 349.98239 356.2836 361.2876 367.8396 370.87561 376.1076 380.00519 383.0412 389.34241 394.34641 400.89841 403.93439 410.21161 415.43161 420.47159"
         y="70.487999"
         id="tspan154">betyder den første noget helt særligt for ham. Så den står i garagen ved siden af den nye.</tspan></text>

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:12px;font-family:Minion;-inkscape-font-specification:Minion-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text172"><tspan
         x="0 7.0464001 10.2384 13.2624 16.298401 22.634399 27.8664 33.505199 36.529202 39.721199 45.193199 48.229198 53.461201 58.007999 64.222801 69.406799 72.466797 78.7668 83.772003 88.176003 91.211998 96.924004 103.128 107.388 112.3932 118.9452 121.9812 125.1732 128.2092 133.2144 139.7664 142.8024 148.98241 154.2144 160.7664 166.64639 169.1676 172.2036 178.43159 183.90359 186.93961 191.1996 196.26241 199.16879 204.4512 210.62041 220.50841 223.5444 229.9404 235.17239 241.7244 244.76041 249.76559 254.1696 257.2056 262.84439 265.86841 271.1232 277.4592 280.49521 284.0004 290.16959 294.57361 297.60959 301.8696 305.06161 308.76959 311.8056 314.8656 321.05881 326.95081 329.47321 332.50919 336.7692 342.13321 348.68521 353.72519 357.9852 361.02121 367.41721 372.6492 379.2012 381.7236 384.75961 389.99161 393.69958 396.7356 403.03561 408.1116 411.81961 414.85559 419.85959 424.26361 427.29959 433.6008 438.7836 441.8436 444.86761 448.0596 453.53159 457.23959 460.2756 465.5076 469.21561"
         y="0"
         id="tspan162">Til daglig arbejder Søren i en bank, og selvom han er glad for sit job, synes han, at det er dejligt at </tspan><tspan
         x="0 3.0239999 8.0531998 13.3464 18.3864 21.4224 27.9744 34.201199 39.6492 44.725201 48.433201 51.4692 57.8652 62.928001 65.952003 69.660004 72.695999 77.928001 84.480003 90.779999 95.856003 99.564003 102.0864 105.1224 111.6744 116.9064 121.3104 124.3464 130.7424 135.9744 142.5264 145.56239 151.9584 157.1904 161.59441 164.6304 168.17039 172.70641 175.89841 178.4196 181.4556 190.47 195.702 202.254 205.28999 211.17 217.37399 221.634 226.638 231.04201 234.078 237.618 240.498 245.53799 251.418 255.67799 258.20041 261.23639 264.97919 268.1712 271.87921 274.91519 279.92041 286.47241 289.50839 293.20441 299.68439 304.08841 307.12439 313.46039 318.69241 321.72839 325.9884 329.18039 335.73239 338.7684 348.6564 354.86041 358.45081 364.62 368.8812 373.88519 379.2948 384.96121 390.02521 393.04919 395.57159 398.6076 405.15961 410.3916 414.79559 417.8316 424.2276 429.45959 436.0116 439.04761 444.69 450.85919 460.74719 470.63519 475.63919 480.04321"
         y="23.496"
         id="tspan164">lave noget helt andet, når han har fri. Han kører f.eks. tit en tur på sin motorcykel, når han kommer </tspan><tspan

       id="text142"><tspan
         x="0 8.9399996 18.827999 21.864 27.5268 30.7188 37.270802 40.873199 45.877201 50.138401 55.142399 61.694401 64.7304 70.610397 76.8144 81.074402 86.079597 90.483597 93.5196 99.231598 105.4356 109.6956 114.7008 121.2528 124.2888 127.4808 133.36079 139.026 144.06599 147.10201 151.362 156.59399 159.63 169.51801 174.6048 180.0528 185.1288 188.83681 191.8728 198.2088 203.4408 206.47681 216.36481 222.5688 226.1604 232.3284 236.5896 241.5936 247.0032 252.6696 257.73361 260.7576 263.28 266.31601 275.0748 280.15079 283.8588 286.89481 291.89999 296.30399 299.34 302.84521 309.01321 313.41721 316.45319 322.0968 328.30081 331.3248 337.6608 341.3688 343.8912 346.92719 353.15399 358.62601 361.66199 367.9632 373.03799 376.746 379.78201 385.66199 390.89401 397.44601 400.48199 406.7088 412.25159 416.5116 421.74359 424.7796 430.26361 438.1116 442.3728 447.41281 450.44879 453.9888 459.22079 463.6716 466.69559 469.8876 475.35959 479.0676 481.59"
         y="0"
         id="tspan132">Om vinteren kører Søren ikke så meget på motorcykel. Det er for koldt, og det kan også være farligt, </tspan><tspan
         x="0 6.552 11.784 16.188 19.224001 25.5252 30.6 34.307999 37.344002 42.348 46.751999 49.787998 59.675999 65.879997 70.354797 76.234802 79.942802 82.463997 85.5 91.727997 97.199997 100.236 106.5372 111.5412 115.9452 118.9812 123.9864 128.3904 131.42641 134.61839 138.8784 141.9144 148.2504 153.48241 156.5184 161.8116 166.99561 170.0556 175.0596 181.6116 186.6516 189.174 192.21001 196.242 199.278 203.53799 207.1404 212.2032 218.50439 223.57919 227.2872 230.3232 233.8284 239.9976 244.4016 247.43761 253.5816 258.06839 264.5484 269.9964 275.00159 279.40561 282.44159 288.15359 294.3576 298.61761 303.62161 310.17361 313.20959 323.0976 328.18439 333.63361 338.7084 342.41641 345.45239 349.19519 352.38721 358.72321 361.75919 368.09521 373.32721 376.36319 380.6232 383.81519 387.52319 390.5592 396.04321 403.8912 408.36481 414.24481 418.50479 422.10721 427.17001 433.50601 436.0296 439.06561 445.16281 450.44519 456.61319 461.01721 464.05319 470.44919 475.68121 482.23318"
         y="23.496"
         id="tspan134">når det er mørkt, og der er is på vejene. I stedet for bruger Søren meget tid på sit værksted, hvor han </tspan><tspan
         x="0 4.2600002 9.2651997 15.8172 20.0772 25.0812 29.485201 32.521198 38.749199 44.221199 47.257198 51.5172 56.5452 62.881199 68.113197 72.373199 77.378403 81.638397 86.6436 91.0476 94.083603 98.343597 101.5356 108.0876 111.1236 121.0116 127.2156 130.806 136.9752 141.2352 146.2392 151.64999 157.3152 162.3792 165.4032 167.9256 170.96159 179.7216 184.7964 188.50439 191.54041 195.0804 200.31239 204.7164 207.7524 214.14841 219.3804 225.9324 228.9684 233.22839 239.7804 244.81081 250.248 254.508 259.5708 265.87201 270.91199 273.948 277.48801 280.67999 287.23199 292.83481 297.09601 302.13599 305.172 310.40399 313.944 316.4664 319.50241 323.76239 328.99438 332.0304 338.42639 343.65839 350.21039 353.2464 357.50641 363.38641 368.61841 371.6424 374.67841 380.82361 385.3092 391.78922 397.23721 402.27719 405.3132 408.33719 413.56921 420.12119 425.5932 428.62921 432.37201 435.564 441.89999 444.936 451.272 456.504 459.54001 464.772 468.48001"
         y="46.992001"
         id="tspan136">renser og reparerer sin motorcykel. Det får han snavsede fingre af, så han skal bruge lang tid på at </tspan><tspan
         x="0 4.2600002 9.2651997 15.8172 20.0772 25.117201 28.1532 34.549198 42.397202 48.9492 55.249199 60.254398 64.658401 67.694397 73.874397 79.1064 84.554398 89.571602 93.111603 96.713997 101.718 105.4512 107.9736 111.0096 117.0096 123.0096 129.0096 135.0096 141.0096 147.0096 153.0096 159.0096 165.0096 171.0096 177.0096 183.0096 189.0096 195.0096 201.0096 207.0096 209.532 212.56799 218.53439 224.7036 229.1076 232.1436 238.4436 243.51961 247.2276 250.2636 255.2688 259.67279 262.7088 267.71399 274.26599 277.302 282.7272 288.966 295.302 298.33801 308.22601 313.45801 319.758 324.798 327.83401 333.06601 336.77399 339.81 344.07001 347.09399 352.32599 358.6272 365.022 370.06201 373.09799 378.32999 382.22641 385.26239 391.59839 396.83041 399.35281 402.38879 408.9408 414.17279 418.57681 421.61279 428.00879 433.24081 439.79279 442.8288 448.47119 454.64041 464.52841 474.41641 479.42041 483.8244"
         y="70.487999"
         id="tspan138">rense hænder bagefter. ________________. For det er en god måde at slappe af på, når han kommer </tspan><tspan
         x="0 6.3959999 9.4560003 14.46 24.348 27.384001 32.401199 35.9412 39.543598 44.548801 48.952801 51.9888 56.992802 63.5448 66.580803 72.976799 78.208801 82.468803 88.804802 91.840797 97.0728 101.6208 107.8356 113.0184 116.0784 122.4144 126.6744 133.01041 138.2424 143.7144 146.7504 149.9424 152.97839 159.1584 164.3904 170.9424 176.6088 181.61279 188.16479"
         y="93.984001"
         id="tspan140">hjem efter en hård arbejdsdag i banken.</tspan></text>

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:12px;font-family:Minion;-inkscape-font-specification:Minion-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text158"><tspan
         x="0 5.7119999 11.916 16.176001 21.1812 27.7332 30.769199 37.165199 42.397202 46.801201 49.8372 54.841202 61.3932 64.429199 68.689201 72.279602 78.448799 82.852798 85.888802 92.2248 96.628799 102.8328 112.7208 115.4832 118.5192 127.5324 132.7644 139.31641 142.3524 148.0152 151.2072 154.2312 157.2672 162.71519 167.7204 172.20599 178.758 183.798 186.834 193.314 199.64999 202.686 209.022 214.254 217.28999 222.2952 228.8472 231.88319 234.9072 240.13921 246.69119 252.16319 255.1992 265.08719 271.2912 274.88159 281.05081 285.31079 290.31479 295.72559 301.392 306.4548 309.47879 313.17599 319.65601 324.06 327.09601 332.10001 338.65201 344.1828 349.41479 355.9668 361.5816 364.104 367.14001 372.85199 378.08401 381.12 387.51599 392.74799 399.29999 402.336 407.34 411.74399 414.78 420.996 426.08279 431.7804 437.14441 443.69641 450.03241 453.74039"
         y="0"
         id="tspan148">Søren har en stor drøm: Han vil gerne ud på en lang motorcykeltur engang. Så han er begyndt </tspan><tspan
         x="0 5.2319999 8.9399996 11.976 16.236 22.572001 27.804001 32.063999 37.104 40.139999 46.534801 51.540001 58.091999 63.540001 68.580002 71.615997 75.875999 81.108002 90.996002 100.884 105.888 112.44 114.9624 117.9984 127.0116 132.24361 138.79559 141.8316 147.4944 150.6864 153.7104 156.7464 162.1944 167.1996 171.6852 178.2372 183.27721 186.3132 192.19321 198.3972 202.6572 207.6972 210.7332 215.22 221.7 228.252 234.588 238.29601 241.332 244.524 247.56 253.95599 260.436 264.67319 270.81839 277.15439 282.38641 285.42239 288.61441 291.65039 295.42801 299.68921 304.72919 307.7652 317.6532 322.88519 329.43719 334.5 340.79999 345.80521 350.2092 353.24521 359.47321 364.94519 367.9812 374.19601 379.23599 383.496 389.70001 395.14801 400.18799 403.224 407.48401 411.0864 416.15039 422.45041 427.4556 431.18881 433.71121 436.74719 442.84439 448.12561 454.2948 458.69879"
         y="23.496"
         id="tspan150">at spare penge sammen. Han vil gerne køre rundt i Europa i tre måneder og besøge steder, hvor </tspan><tspan
         x="0 9.8879995 15.12 21.672001 24.708 31.26 37.428001 41.914799 51.802799 57.034801 60.0588 63.7668 66.802803 69.994797 75.874802 81.541199 86.5812 89.617203 93.877197 99.1092 102.1452 105.1692 110.244 113.952 116.988 122.868 128.10001 134.65199 137.688 143.3304 149.4984 159.3864 169.2744 174.31441 177.3504 187.2384 192.3024 198.6384 201.67439 207.81841 211.01041 214.03439 217.0704 222.1344 225.21719 228.2412 233.24519 237.6492 240.6852 246.8544 250.39439 253.8996 258.90359 265.4556 269.1636 272.18759 275.37961 280.82761 285.86761 288.90359 292.6824 297.17999 302.41199 308.96399 313.224 319.59479 325.76401 330.3696 334.14719 344.03519 347.2272 353.62201 356.646 361.65121 366.05521 369.09119 373.3512 379.5192 389.4072 392.44321 396.0336 402.2616 407.73361 410.76959 416.9964 422.46841 425.50439 431.6496 438.12961 442.38959 444.91199"
         y="46.992001"
         id="tspan152">man normalt ikke så let kan komme med bil eller offentlige transportmidler som tog og bus. </tspan><tspan
         x="0 6 12 18 24 30 36 42 48 54 60 66 72 78 84 90 96 98.5224 101.5584 107.5248 113.694 118.098 121.134 127.53 132.76199 139.314 142.35001 146.61 151.974 158.526 163.56599 167.826 170.3484 173.3844 179.68559 184.76041 188.4684 191.50439 196.5096 200.9136 203.9496 210.25079 215.4348 218.4948 221.5188 224.7108 230.1828 233.89079 236.9268 243.1068 248.33881 252.5988 257.63879 260.6748 265.9068 269.61481 272.65079 276.3588 281.59079 287.04001 292.07999 295.116 300.34799 304.24438 307.2804 311.54041 315.14279 320.20679 326.54279 329.5788 335.8056 341.27759 344.3136 348.57361 353.61359 356.13599 359.172 365.2692 370.7652 376.01999 382.35599 385.392 391.69321 396.69839 401.10239 404.1384 408.39841 414.0636 419.06879 422.802 425.3244 428.36041 434.58719 440.0592 443.09521 447.35519 452.58719 455.6232 461.09521 467.29919 471.5592 476.59921 479.12161"
         y="70.487999"
         id="tspan154">________________. For han synes, det er dejligt bare at tage af sted og se, hvad der sker, og så gøre, </tspan><tspan
         x="0 6.0971999 11.5932 16.848 23.184 26.219999 32.616001 37.848 44.400002 47.436001 50.976002 56.208 60.612 63.647999 66.636002 71.965202 76.225197 79.933197 82.9692 86.711998 89.903999 92.928001"
         y="93.984001"
         id="tspan156">hvad han får lyst til.</tspan></text>

    <text

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:12px;font-family:Minion;-inkscape-font-specification:Minion-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text174"><tspan
         x="0 5.7119999 11.916 16.176001 21.1812 27.7332 30.769199 36.431999 39.624001 42.647999 45.683998 51.132 56.137199 60.622799 67.174797 72.214798 75.250801 79.510803 84.694801 87.754799 92.014801 97.054802 100.0908 104.3508 109.5828 119.4708 129.3588 134.36279 140.91479 143.95081 153.83881 158.9016 165.23759 168.27361 173.27879 179.8308 182.86681 187.9296 191.01241 194.03641 199.0416 203.4456 206.4816 210.07201 216.276 219.312 224.54401 231.09599 237.43201 241.692 246.73199 249.25439 252.29041 255.79559 261.96481 266.3688 269.40479 275.80081 281.03281 287.58481 290.62079 294.8808 300.24481 306.79681 311.83679 316.0968 318.6192 321.65521 327.95639 333.03119 336.7392 339.77521 344.77921 349.1832 352.21921 358.34039 363.68039 369.17639 374.62439 379.68839 382.7124 385.90439 391.3764 395.08441 398.12039 403.35239 407.06039 410.09641 416.4924 421.52161 426.81601 431.85599 434.892 441.444 447.67081 453.1188 458.12399 464.67599 467.71201 472.944 476.65201"
         y="0"
         id="tspan164">Søren vil gerne rejse sammen med en eller to andre, for han synes, det er hyggeligt at have nogen at </tspan><tspan
         x="0 4.2600002 10.812 16.044001 21.924 27.589199 32.6292 35.665199 45.5532 50.617199 56.953201 59.989201 66.325203 71.557198 74.593201 78.2892 84.769203 89.029198 94.034401 100.5864 103.6224 109.6224 115.6224 121.6224 127.6224 133.62241 139.62241 145.62241 151.62241 157.62241 163.62241 169.62241 175.62241 181.62241 187.62241 193.62241 199.62241 202.14481 205.1808 211.1472 217.3152 221.71919 224.7552 231.1512 236.38319 242.9352 245.97121 250.2312 256.11121 261.3432 264.36719 267.4032 270.94321 274.13519 280.68719 286.98721 292.02719 295.0632 301.6152 307.8432 313.2912 318.29639 324.84839 327.37079 330.4068 336.70801 341.7132 346.11719 349.1532 355.54919 360.78119 365.18521 368.22119 378.03961 384.51959 387.54361 390.7356 396.3504 402.7464 407.81039 414.14639 417.1824 420.6864 426.85559 431.25961 434.29559 439.52759 443.2356 446.27161 452.6676 458.87161 461.8956 468.19559 473.2356"
         y="23.496"
         id="tspan166">snakke med på turen ________________. For han skal finde nogen, der har mulighed for at holde </tspan><tspan
         x="0 3.54 8.0760002 11.268 14.304 17.844 22.3416 27.573601 30.6096 35.841599 40.388401 46.603199 51.787201 54.847198 61.148399 66.1884 69.224403 72.416397 75.4524 79.230003 83.489998 88.529999 91.566002 101.454 106.686 113.238 118.302 124.602 129.60719 133.34039 135.86279 138.8988 145.1256 150.5976 153.63361 157.8936 164.06281 173.95081 176.9868 183.3828 188.61481 193.0188 196.05479 199.0428 204.37199 208.632 212.34 215.37601 221.6028 227.0748 230.11079 236.5056 241.5108 248.06281 253.5108 258.55081 261.58679 265.32959 268.52161 271.54559 274.5816 278.84161 284.07361 290.40961 295.6416 302.1936 305.22961 310.23361 316.78561 319.82159 323.5188 329.99881 333.7308 336.2532 339.28922 348.15961 353.63159 356.6676 360.92761 366.15961 369.19559 373.4556 379.3356 384.5676 387.59161 390.62759 396.9288 402.0036 405.71161 408.74759 413.0076 418.07159 420.978 426.46201 430.00201 436.20599 439.23001 444.67801 449.742 452.76599 455.95801 461.42999 464.466 470.694 476.2356 480.49561 485.7276"
         y="47.495998"
         id="tspan168">fri fra arbejde i tre måneder, og som har lyst og penge til sådan en tur. Og så skal det selvfølgelig også </tspan><tspan
         x="0 5.4840002 13.332 17.591999 22.632 25.667999 32.220001 38.4468 43.896 48.901199 55.453201 57.975601 61.0116 67.4076 72.639603 79.191597 82.2276 88.107597 93.3396 99.891602 102.9276 105.9516 109.1436 115.4448 120.4848 123.0072 126.0432 135.0564 140.28841 146.84039 151.1004 154.1364 159.4296 164.43359 170.9856 174.02161 180.4176 185.6496 190.0536 193.0896 199.39079 204.4308 208.6908 214.1748 222.0228 226.5576 230.8188 235.8588 238.89481 242.08681 247.9668 253.632 258.672 261.70801 271.52521 278.00519 281.02921 284.22119 289.83719 296.23318 301.29599 307.63199 310.668 314.17319 320.34241 324.7464 327.78241 333.0144 336.72241 339.75839 343.4664 348.69839 354.14761 359.18759 362.2236 372.1116 377.1756 383.5116 386.034 389.07001 392.5752 398.74319 403.14719 406.1832 412.57919 417.81119 424.36319 427.3992 433.7952 439.02719 443.43121 446.46719 452.10959 458.27759 464.82959 469.8696 472.90561 479.13361 484.60559"
         y="71.496002"
         id="tspan170">være nogen, han kan lide. Hans ven har desværre ikke mulighed for at tage med, for han har kone og </tspan><tspan
         x="0 6.1799998 12.384 16.8696 23.4216 25.944 28.98 33.240002 39.409199 49.297199 52.333199 58.729198 63.961201 70.513199 73.549202 76.741203 82.621201 88.2864 93.326401 96.362396 102.2424 107.4744 114.0264 117.0624 121.3224 126.5064 129.56641 133.8264 138.86639 141.9024 147.3864 155.23441 161.1144 164.15041 167.6904 172.188 177.42 180.45599 183.64799 186.68401 190.944 196.17599 199.21201 202.23599 207.468 214.02 219.492 222.528 226.2708 229.4628 235.7988"
         y="95.496002"
         id="tspan172">børn, som han ikke kan rejse væk fra i så lang tid.</tspan></text>

       id="text126"><tspan
         x="0 3.6731999 8.7600002 14.232 17.268 21.045601 25.4496 33.2976 39.849602 44.8536 49.257599 52.4856 55.521599 64.413597 69.645599 74.049599 77.085602 86.973602 92.205597 98.757599 101.7936 107.0256 111.5724 117.7884 122.9712 126.0312 132.3324 137.3364 141.7404 144.7764 151.17239 156.1776 160.5816 163.6176 166.8096 169.8456 174.71761 179.72279 186.2748 190.0524 194.31239 199.38721 203.0952 205.6188 208.6548 214.53481 219.7668 226.3188"
         y="0"
         id="tspan98">Jeg træner! Når man arbejder her i centret, kan </tspan><tspan
         x="0 9.8879995 15.12 21.672001 24.708 30.350401 36.5196 46.4076 56.295601 61.335602 64.371597 70.767601 75.772797 80.176804 83.212799 89.439598 94.911598 97.947601 101.7264 106.1304 113.9784 120.5304 125.5704 128.6064 131.6304 134.8224 140.2704 145.31039 148.34641 152.6064 157.83839 160.8744 164.6172 167.8092 171.5172 174.0396 177.07561 186.96359 192.1956 198.7476 201.7836 207.44521 210.63721 213.66119 216.18359 219.2196 223.4796 228.71159"
         y="15.996"
         id="tspan100">man komme her og træne lige så tit, man vil, så </tspan><tspan
         x="0 6.3011999 11.376 15.084 18.120001 23.591999 29.796 34.200001 37.236 40.296001 45.382801 50.997601 53.52 56.556 60.229198 65.316002 70.788002 73.823997 79.486801 82.678802 85.702797 88.7388 91.798798 98.0028 101.0388 107.2656 112.8084 117.0684 122.3004 125.3364 130.78439 135.7896 140.27521 146.82719 151.8672 154.9032 159.16319 164.226 167.1324 172.61639 175.6524 181.1364 188.98441 193.2444 198.28439 201.3204 204.51241 207.5484 212.9736 219.21359 225.54961"
         y="31.992001"
         id="tspan102">det gør jeg. Jeg vil jo også gerne selv være i god </tspan><tspan
         x="0 3.5051999 9.6731997 14.16 24.048 26.5704 29.6064 39.987598 44.992802 51.5448 54.580799 57.6408 62.7276 68.1996 71.235603 74.259598 79.288803 84.582001 89.587196 93.991203 97.027199 101.2872 106.35 109.2576 114.7416 118.2816 124.4856 127.5096 132.9576 138.0204 141.0444 144.2364 149.7084 152.7444 158.9724 164.51401 168.774 174.006 177.04201 182.274 188.826 195.162 199.422 204.46201 207.498 211.2408 214.4328 220.9848 226.4568"
         y="47.987999"
         id="tspan104">form. Men jeg laver selvfølgelig også andre ting </tspan><tspan
         x="0 6 9.0360003 12.576 15.456 20.496 26.375999 30.636 33.158401 36.194401 42.074402 47.3064 53.858398 56.894402 59.954399 65.040001 70.512001 73.547997 78.973198 85.213203 91.549202 95.257202 98.293198 101.3172 104.5092 110.8092 115.8492 118.8852 124.1172 127.8252 130.86121 136.33321 141.5652 144.6012 151.08121 157.41721 160.4532 166.67999 172.15199 175.188 179.448 185.784 188.976 193.23599 198.276 201.312 205.57201 210.804 220.692"
         y="63.984001"
         id="tspan106">– f.eks. kan jeg godt lide at gå ud og spise sam-</tspan><tspan
         x="0 9.8879995 14.8932 21.4452 24.481199 34.369202 39.433201 45.769199 48.805199 58.693199 61.885201 68.437202 73.477203 76.513199 81.806396 86.8116 93.363602 96.555603 103.1076 109.4076 114.4128 118.1448 120.6684 123.7044 129.9312 135.4032 138.43919 141.49921 146.586 152.058 155.09399 160.56599 165.798 170.202 173.23801 179.4648 185.0076 189.26759 194.4996 197.5356 207.4236 212.5092 217.9584 223.0332 226.7412 229.77721 232.96919"
         y="79.980003"
         id="tspan108">men med mine veninder, og jeg går også meget i </tspan><tspan
         x="0 6.1440001 9.3360004 15.5628 21.1668 25.6644 30.8964 34.400398 39.4044 45.956402 48.478802"
         y="95.975998"
         id="tspan110">biografen. </tspan><tspan
         x="272.12399 280.884 285.9588 289.66681 292.70279 297.70801 302.112 305.14801 315.03601 320.1228 325.57199 330.64679 334.3548 337.39081 340.896 347.064 351.44519 355.7052 361.37039 366.43439 369.51721 372.5412 375.73318 381.2052 384.91321 387.43561 390.47159 399.43799 404.44199 408.84601 411.88199 417.5256 423.6936 433.5816 443.4696 448.47479 452.87881 455.91479 465.8028 471.03479 477.58679 483.03479 488.0748"
         y="-0.024"
         id="tspan112">Det er meget forskelligt. Her kommer mange </tspan><tspan
         x="272.12399 276.384 279.40799 284.64001 290.18161 294.44159 297.4776 307.3656 312.37079 318.92279 325.47479 330.5148 334.77481 340.44 345.44519 349.17841 351.70081 354.73679 358.27679 361.1568 366.19681 372.07681 376.33679 378.85919 381.8952 391.7832 399.6312 406.1832 412.5192 415.0416 418.07761 422.33759 428.50562 438.39359 441.4296 446.87881 451.88281 456.3696 462.9216 467.96161 470.99759 476.6604 479.85239 482.8764 485.91241 492.30841 497.33759 502.63199 507.672"
         y="15.972"
         id="tspan114">slags mennesker, f.eks. mænd, som gerne vil have </tspan><tspan
         x="272.12399 276.384 279.9744 286.14359 290.40359 295.4436 298.47961 308.29681 314.77679 319.0368 324.91681 327.9408 332.94601 336.6792 339.2016 342.23761 348.46439 353.9364 356.97241 362.85239 368.5152 371.70721 378.25919 384.56039 389.56439 393.29761 395.82001 398.85599 403.116 409.28519 419.17319 422.2092 427.6572 432.66241 437.14801 443.70001 448.73999 451.776 457.43881 460.6308 463.65479 466.6908 470.3988 475.6308 481.84561 486.88559 489.9216 494.18161 497.3736 502.9884 505.5108"
         y="31.968"
         id="tspan116">store muskler, og kvinder, som gerne vil tabe sig. </tspan><tspan
         x="272.12399 282.50641 287.51041 294.06241 297.09839 303.3996 308.40479 312.80881 315.84479 320.85001 325.254 328.29001 334.51801 340.0596 344.31961 349.55161 352.58759 362.47559 367.70761 374.25961 379.70761 384.74759 387.26999 390.306 396.60721 401.6124 406.01639 409.0524 414.69479 420.86279 430.75079 440.63879 445.64401 449.3772 451.8996 454.93561 461.1156 466.3476 470.6076 475.64761 478.68359 482.18881 488.35681 492.61801 498.95401 502.146"
         y="47.964001"
         id="tspan118">Men der er også mange, der kommer, bare fordi </tspan><tspan
         x="272.12399 278.4252 283.46521 286.50119 291.94919 296.95441 301.44 307.992 313.03201 316.06799 321.7308 324.92279 327.94681 330.98279 336.4668 344.31479 348.5748 353.61481 356.65079 359.8428 362.87881 368.30399 374.54279 380.87881 383.91479 387.41879 393.58801 398.07361 407.96161 410.48401 413.51999 422.28 427.28519 431.7468 435.25201 441.4212 445.8252 448.86121 452.40121 457.63321 462.0372 465.07321 474.96121 480.19321 486.74521"
         y="63.959999"
         id="tspan120">de gerne vil være i god form. Derfor får man </tspan><tspan
         x="272.12399 278.35199 283.89359 288.15359 293.38559 296.4216 301.65359 304.67761 308.42041 311.6124 317.94839 320.98441 326.0592 329.76721 332.80319 339.198 344.20319 348.58319 352.8432 359.01239 365.56439 368.58841 371.7804 377.25241 380.96039 383.9964 390.29761 394.53479 400.7616 406.3656 410.86319 416.09521 425.98318 428.50562 431.5416 437.8428 442.8468 447.25079 450.2868 456.6228 461.8548 466.11481 470.37479 475.38 479.784 482.82001 486.56281 489.75479 492.77881 495.81479 502.116 507.15601"
         y="79.956001"
         id="tspan122">også altid et personligt program, der passer til de </tspan><tspan
         x="272.12399 282.01199 287.24399 290.26801 292.79041 295.82639 305.71439 310.94641 317.49841 320.53439 326.93039 332.16241 335.89441 338.41681 341.45279 348.00479 353.23679 357.64081 360.67679 370.56479 375.79681 382.34879 385.3848 389.64481 393.35281 398.58481 403.1904 406.79279 411.79681 416.20081 419.23679 425.63281 430.638 434.37119 436.89359"
         y="95.952003"
         id="tspan124">mål, man har, når man starter her. </tspan></text>

         x="0 8.7600002 13.8348 17.542801 20.5788 25.584 29.988001 33.023998 42.911999 47.998798 53.448002 58.5228 62.230801 65.2668 68.772003 74.940002 79.321198 83.5812 89.246399 94.310402 97.393204 100.4172 103.6092 109.0812 112.7892 115.3116 118.3476 121.8516 128.0208 132.4248 135.4608 138.5208 143.6076 149.07961 152.1156 157.1196 161.52361 164.5596 169.7916 176.3436 180.60361 185.8356 189.54359 192.57961 195.77161 198.8076 203.8824 207.59039 210.6264 214.8864 219.9612 223.6692"
         y="0"
         id="tspan132">Det er meget forskelligt, for jeg er ansat i et ret </tspan><tspan
         x="0 3.0239999 6.2160001 9.2988005 12.3228 17.362801 20.3988 25.2708 30.275999 36.827999 40.429199 45.434399 49.167599 51.689999 54.726002 58.986 64.218002 67.253998 73.650002 78.653999 83.057999 86.094002 89.117996 94.148399 99.441597 104.4468 108.8508 111.8868 117.5484 120.7404 123.7764 129.00841 132.0912 135.1152 140.1552 143.19119 147.4512 152.6832 162.5712 172.4592 177.4632 184.0152 187.05119 190.0752 193.2672 199.6032 203.3112 206.3472 211.57919 215.47681"
         y="15.996"
         id="tspan134">lille center, så her laver vi alle sammen lidt af </tspan><tspan
         x="0 6.0971999 11.3904 16.395599 21.0012 24.7092 27.2316 30.267599 40.889999 44.082001 50.633999 53.669998 57.93 61.638 67.842003 72.222 76.482002 80.084396 85.124397 88.1604 94.305603 100.6884 106.2192 111.2484 116.5416 121.5816 124.6176 129.6228 134.02679 137.06281 142.2948 146.00281 149.0388 155.4348 158.4948 166.3428 169.36681 175.76041 180.8004 183.8364 189.7164 196.1964 202.7484 209.04961 214.05479 218.54041 225.09241 230.1324"
         y="31.992001"
         id="tspan136">hvert. Min største opgave er at hjælpe kunderne </tspan><tspan
         x="0 9.8879995 14.9508 21.2868 24.3228 34.2108 39.442799 43.702801 49.582802 52.774799 59.326801 64.330803 68.816399 75.368401 80.408401 82.930801 85.966797 96.348 101.3532 107.9052 110.9412 114.0012 119.088 124.56 127.596 132.60001 137.004 140.03999 146.26801 151.8096 156.0696 161.30161 164.3376 167.5296 174.0816 178.3416 182.12041 186.606 193.086 198.966 202.674 208.87801 213.282 216.31799 222.65401 227.886"
         y="47.987999"
         id="tspan138">med maskinerne. Men jeg er også instruktør på </tspan><tspan
         x="0 3.5051999 9.6731997 14.0544 18.3144 23.979601 29.0436 32.1264 35.150398 38.3424 43.790401 48.830399 51.866402 58.262402 64.4664 67.490402 73.826401 76.348801 79.384804 88.253998 93.725998 96.762001 101.022 106.254 109.29 113.55 119.43 124.662 127.686 130.722 133.782 138.8688 144.34081 147.3768 153.60361 159.14639 163.4064 168.6384 171.67439 176.39999 181.62 187.95599 194.2572 199.2972 202.33321 208.47839 214.81441 217.8504 224.0784 229.5504"
         y="63.984001"
         id="tspan140">forskellige hold. Og så skal jeg også rydde op og </tspan><tspan
         x="0 5.4720001 11.676 15.936 20.976 24.011999 27.035999 30.228001 36.563999 40.271999 43.307999 47.568001 52.5732 59.125198 62.833199 65.355598 68.391602 72.651604 77.883598 80.919601 87.315598 92.319603 96.723602 99.759598 106.1556 111.2196 114.2436 119.2836 122.3196 126.0624 129.25439 135.5544 140.5596 147.1116 150.1476 155.1528 159.55679 162.5928 166.8528 171.8568 178.4088 182.11681 185.1528 191.3808 196.8528 199.88879 206.22479 214.0728 220.6248 224.33279 226.85519"
         y="79.980003"
         id="tspan142">gøre lidt rent, så her hele tiden er rent og pænt. </tspan><tspan
         x="0 5.7360001 11.904 21.792 31.68 36.720001 39.756001 43.498798 46.6908 52.992001 57.995998 62.400002 65.435997 71.772003 77.003998 81.264 85.524002 90.529198 94.933197 97.9692 101.0292 106.116 111.588 114.624 120.8508 126.3936 130.65359 135.8856 138.9216 142.524 147.58681 150.61079 155.62801 159.132 165.30119 171.8532 176.8584 183.4104 185.9328"
         y="95.975998"
         id="tspan144">Somme tider passer jeg også telefonen. </tspan><tspan
         x="272.12399 275.84641 281.0784 283.6008 286.63681 293.03281 298.0968 301.12079 304.8288 307.86481 312.12479 315.3168 321.19681 326.86319 331.86841 336.474 340.18201 342.70441 345.74039 349.41241 354.5004 359.97241 363.00839 366.78601 371.02319 377.19119 381.59521 384.6312 388.1712 393.4032 399.2832 403.026 406.21799 410.478 416.358 418.8804 421.91641 427.14841 430.2312 433.25519 438.25919 442.52039 447.58319 453.8844 458.92441 461.96039 468.2616 473.26559 479.8176 482.85361 487.11359 490.82159 496.05359 500.172"
         y="-0.024"
         id="tspan146">Ja, helt sikkert. Jeg tror faktisk, allerede den star-</tspan><tspan
         x="272.12399 275.72641 280.79041 287.09039 292.1304 294.6528 297.68881 304.02481 309.25681 312.29279 315.35281 320.43961 325.91159 328.9476 334.4436 339.6756 344.07959 347.1156 352.1196 358.6716 361.70761 368.10361 373.1676 376.19159 379.8996 382.93561 385.95959 389.15161 392.23318 395.2572 400.29721 403.33319 409.66919 412.86121 418.3092 423.34921 425.8728 428.90881 435.13559 440.6076 443.64359 446.70361 451.79041 457.26239 460.2984 465.79321 471.02521 475.4292 478.46521 488.35321 493.41721 499.7532"
         y="15.972"
         id="tspan148">tede, da jeg var en helt lille pige, og jeg var med </tspan><tspan
         x="272.12399 282.01199 285.20401 291.75601 294.79199 304.67999 310.84799 315.25201 318.28799 322.03201 325.224 328.24799 331.284 336.9816 342.51239 352.40039 358.95239 364.18439 368.4444 372.18719 375.37921 381.25919 383.78159 386.8176 390.49081 395.57761 401.04959 404.0856 409.96561 415.1976 421.7496 424.78561 431.112 437.59201 441.85199 447.51721 452.55719 455.07959 458.1156 463.3476 467.0556 470.09161 473.15161 478.2384 483.71039 486.7464 491.00641 496.37039 502.92239"
         y="31.968"
         id="tspan150">min mor til gymnastik. Jeg kan huske, at jeg syn-</tspan><tspan
         x="272.12399 275.72641 280.76639 285.0264 287.5488 290.58481 296.88599 301.96078 305.66879 308.7048 314.20081 319.4328 323.83679 326.8728 331.13281 334.19281 340.2648 345.74881 349.45679 352.4928 357.72479 361.4328 364.46881 368.72879 373.7688 376.80481 383.14081 388.3728 390.8952 393.93121 399.57239 402.7644 409.06561 414.0708 420.6228 423.65881 429.8736 434.96039 440.65799 446.022 452.57401 458.91 462.51239 467.5524 470.58841 473.64841 478.7352 484.20721 487.24319 493.47 499.0116 503.27161 508.5036"
         y="47.964001"
         id="tspan152">tes, det var sjovt at se på. Siden begyndte jeg også </tspan><tspan
         x="272.12399 276.384 281.448 284.3544 289.83841 292.87439 298.10641 301.81439 304.8504 310.32239 315.55441 318.59039 322.33441 325.5264 328.55042 331.5864 335.09039 341.25961 345.63959 349.8996 355.56601 360.62881 363.71161 366.7356 369.92761 375.37561 380.41559 383.4516 386.9556 393.12479 397.61041 407.49841 412.5036 416.90759 419.9436 423.4476 429.61679 434.02081 437.05679 442.75439 448.28519 458.17319 464.72519 469.95721 474.21719 477.95999 481.15201 487.03201 489.55441"
         y="63.959999"
         id="tspan154">selv at gå til forskellige former for gymnastik, </tspan><tspan
         x="272.12399 278.45999 283.69199 290.24399 294.504 297.54001 303.76682 309.2388 312.27481 315.81479 319.00681 322.78561 329.33759 334.37759 338.6376 342.89761 345.42001 348.45599 354.168 359.39999 362.436 365.54279 370.77481 373.29721 376.33319 379.52521 386.07721 389.6796 394.68481 398.94479 403.9848 408.24481 412.50479 417.51001 424.06201 427.09799 433.49399 438.72601 443.13 446.16599 452.56201 457.62601 460.64999 464.358 467.39401 471.65399 474.84601 480.72601 486.3912 491.39639 496.00201 499.70999"
         y="79.956001"
         id="tspan156">dans og fitness. Så ja, interessen har helt sikkert </tspan><tspan
         x="272.12399 277.35599 280.38 284.1228 287.31479 293.65079 296.6868 302.17081 310.0188 314.27881 319.35361 323.06161 326.0976 332.3988 337.40399 341.13599 343.65961"
         y="95.952003"
         id="tspan158">altid været der. </tspan></text>

       id="text196"><tspan
         x="0 8.7600002 13.764 20.316 23.351999 28.357201 32.7612 35.797199 40.333199 43.5252 48.9972 52.740002 55.931999 61.403999 64.440002 68.699997 75.036003 82.884003 89.435997 95.736 100.7412 107.2932 113.5932 118.6332 121.1556 124.1916 130.4196 135.8916 138.9276 141.98759 147.0744 152.5464 155.5824 158.6064 166.45441 171.06 174.6624 179.70239 182.7384 192.6264 197.8584 204.4104 209.8584 214.89841 217.9344 223.5972 226.7892 232.2612"
         y="0"
         id="tspan166">Den er rigtig spændende, og jeg lærte mange vig-</tspan><tspan
         x="0 3.7428 6.9348001 12.3828 17.4228 20.458799 24.201599 27.3936 33.945599 39.560398 42.082802 45.118801 49.378799 55.548 65.435997 68.472 71.531998 76.618797 82.090797 85.126801 91.270798 95.757599 102.2376 107.6856 112.6908 117.0948 120.1308 126.2268 131.52119 136.52521 140.9292 143.96519 150.30119 155.5332 161.0052 164.0412 167.2332 170.2692 180.1572 183.3492 187.05721 190.0932 195.3252 199.87199 206.08681 211.2708 214.3308 220.632 225.672"
         y="15.996"
         id="tspan168">tige ting, som jeg bruger hver dag i mit arbejde </tspan><tspan
         x="0 6.3959999 11.4012 15.8052 18.8412 22.033199 25.069201 29.9412 34.9464 41.498402 45.277199 49.537201 54.612 58.32 60.8424 63.878399 74.260803 79.264801 85.816803 88.852798 95.153999 100.2288 103.9368 106.9728 112.4688 117.7008 122.1048 125.1408 131.3676 136.9104 141.17039 146.4024 149.4384 152.4624 155.6544 161.9904 165.69839 168.73441 175.1304 180.3624 184.62241 190.9584 194.6664 197.70239 201.2076 207.3768 211.78081 214.8168 224.7048 227.8968 233.3688"
         y="31.992001"
         id="tspan170">her i centret. Men det var også lidt hårdt for mig </tspan><tspan
         x="0 5.2319999 8.9399996 11.976 15.684 20.916 26.364 31.403999 34.439999 40.741199 45.745201 52.297199 54.819599 57.855598 61.360802 67.529999 71.790001 78.125999 81.318001 84.353996 90.655197 95.659203 100.0632 103.0992 108.5952 113.8272 118.2312 121.2672 131.1552 136.242 141.69 146.7648 150.47279 153.5088 163.3968 168.40199 172.662 177.702 180.73801 184.34039 189.4044 195.5724 200.1084 203.3004 205.8228 208.8588 213.864 220.416 226.752"
         y="47.987999"
         id="tspan172">at tage den, fordi der var meget mere teori, end </tspan><tspan
         x="0 3.0599999 8.1468 13.6188 16.6548 20.4324 24.6696 30.909599 35.972401 42.273602 47.313599 50.541599 53.577599 59.2896 64.521599 67.557602 70.617599 75.703201 81.175201 84.211197 88.471199 94.351196 100.8312 103.914 106.938 111.978 115.014 121.1592 125.6448 132.1248 137.5728 142.61279 145.6488 148.67281 153.9048 160.4568 165.9288 168.9648 172.7076 175.8996 182.2356 185.27161 191.6076 196.8396 199.8756 205.1076 208.8156 211.85159 214.8756 222.7236 226.9836 232.02361 234.54601"
         y="63.984001"
         id="tspan174">jeg troede! Så jeg skulle bruge lang tid på at læse, </tspan><tspan
         x="0 6.2280002 11.7 14.736 21.035999 26.112 29.82 32.855999 39.251999 44.484001 48.888 51.924 54.984001 60.070801 65.542801 68.578796 73.810799 76.834801 83.170799 87.706802 90.898804 96.370796 99.406799 104.8908 112.7388 116.9976 122.0736 125.7816 128.8176 133.07761 138.3096 141.3456 146.7708 153.0096 159.3456 162.38161 166.1244 169.31641 172.34039 174.86279 177.8988 181.57201 186.6588 192.1308 195.16679 201.0468 207.52679 214.0788 220.6308 225.67081"
         y="79.980003"
         id="tspan176">og det har jeg aldrig været så god til. Jeg kunne </tspan><tspan
         x="0 5.8800001 8.9040003 14.136 18.7416 22.4496 25.4856 31.700399 36.7644 43.100399 47.360401 51.068401 54.104401 57.128399 60.3204 66.620399 71.6604 74.696404 80.997597 86.0028 92.554802 95.590797 101.8908 106.3884 111.6204 117.5004 121.2432 124.4352 128.69521 134.3616 139.4016 142.43761 148.7388 153.80161 156.82561 159.34801"
         y="95.975998"
         id="tspan178">klart bedst lide den praktiske del. </tspan><tspan
         x="272.12399 280.884 285.9588 289.66681 292.70279 297.70801 302.112 305.14801 311.70001 316.7052 326.5932 330.30121 333.33719 338.56921 342.27719 345.3132 349.57321 355.06799 360.29999 364.56119 369.6012 372.63721 378.97321 384.2052 386.96759 390.0036 398.76239 403.83841 407.54639 410.5824 416.97839 421.98239 426.38641 429.42239 434.42761 438.8316 441.86761 451.75562 454.9476 461.4996 464.53561 468.79559 472.38721 478.55521 482.81519 487.85519"
         y="-0.024"
         id="tspan180">Det er nemt at svare på: Det her er min store </tspan><tspan
         x="272.12399 275.31601 281.86801 285.4704 290.47559 294.7356 299.7756 304.03561 308.29559 313.3356 315.858 318.89401 325.12079 330.5928 333.62881 336.68881 341.7756 347.24759 350.2836 354.54361 359.90759 366.45959 371.4996 375.75961 378.28201 381.31799 387.6192 392.694 396.40201 399.43799 404.44199 408.84601 411.88199 417.5448 420.73679 426.2088 429.9516 433.14359 438.6156 442.32361 445.35959 450.59161 454.29959 457.3356 460.35959 465.38879 470.68201 475.72198 478.758 485.31 491.53799 496.98599 502.06201 505.76999 508.2912"
         y="15.972"
         id="tspan182">interesse, og jeg synes, det er vigtigt at lave noget, </tspan><tspan
         x="272.12399 282.01199 287.24399 293.79599 296.832 302.49481 305.6868 310.1604 315.82681 320.88959 323.9136 327.10559 332.57761 335.61359 341.03879 347.27759 353.61359 357.32159 360.3576 366.23761 371.4696 378.02161 381.05759 384.0816 387.27359 393.57361 398.61359 401.13599 404.172 408.43201 413.664 416.70001 423.00119 428.00641 432.46799 435.97321 442.1424 445.87561 448.39801 451.43399 459.95639 466.4364 469.47241 475.35239 480.58441 487.13641 490.17239 493.23239 498.31921 503.7912"
         y="31.968"
         id="tspan184">man virkelig godt kan lide, så derfor. Nu kan jeg </tspan><tspan
         x="272.12399 278.51999 284.724 287.74799 294.04919 299.0892 302.12521 312.01321 315.2052 320.67719 323.7132 326.90521 329.94119 335.36639 341.60641 347.94241 350.97839 354.48239 360.65161 365.13721 375.02521 378.06119 384.06119 387.0972 393.32401 398.79599 401.832 404.892 409.97879 415.45081 418.48679 422.02679 427.25879 431.66281 434.69879 439.70401 446.25601 452.59201 458.92801 464.16 467.19601 473.5896 478.59479 485.14679 490.59479 495.6348"
         y="47.964001"
         id="tspan186">holde mig i god form – og jeg får endda penge </tspan><tspan
         x="272.12399 275.62921 281.79721 286.2012 289.23721 295.53839 300.61319 304.3212 307.54919 310.58521 314.25839 319.34521 324.8172 327.85321 331.39319 336.62521 341.02921 344.06519 350.29199 355.83481 360.09479 365.32681 368.36279 378.17999 384.66 387.68399 390.87601 396.49081 402.88681 407.95081 414.2868 417.32281 420.82681 426.996 431.39999 434.436 439.668 443.37601 446.41199 452.71201 457.776 460.79999 465.84 468.87601 478.76401 481.95599 488.508"
         y="63.959999"
         id="tspan188">for det! Jeg får også mulighed for at dele min </tspan><tspan
         x="272.12399 277.76279 280.7868 288.6348 294.936 299.97601 303.01199 308.30521 313.36801 319.70401 322.73999 327.97198 331.67999 334.716 338.49481 342.8988 350.7468 357.2988 362.33881 365.37479 375.26279 380.32559 386.66159 389.6976 394.9296 401.4816 407.8176 412.07761 417.11761 420.15359 430.0416 435.04559 441.5976 448.1496 453.18961 457.44958 463.116 468.12119 472.52521 475.56119 481.78799 487.26001 490.29599 493.80121 499.96921 504.3732"
         y="79.956001"
         id="tspan190">glæde ved at træne med andre mennesker og for </tspan><tspan
         x="272.12399 277.35599 281.064 284.10001 290.496 293.556 301.40399 304.42801 310.82159 315.8616 318.89761 325.19879 330.20401 340.09201 343.12799 353.01599 358.0788 364.41479 367.45081 372.6828 376.39081 379.42679 385.97879 391.21078 394.2468 400.54681 405.552 409.81201 414.85199 419.112 422.14801 432.03601 437.26801 440.29199 442.81439 445.8504 454.61041 459.68521 463.39319 466.4292 471.43439 475.83841 478.87439 485.2692 490.27319 494.388"
         y="95.952003"
         id="tspan192">at hjælpe dem med at nå deres mål. Det er per-</tspan><tspan
         x="272.12399 275.62921 280.66919 286.54919 290.2572 293.29321 296.79721 302.9664 307.37039 310.4064 320.2944 323.48639 329.1012 331.6236"
         y="111.948"
         id="tspan194">fekt for mig. </tspan></text>

       id="text236"><tspan
         x="0 3.6731999 8.7600002 14.232 17.268 23.664 28.896 33.299999 36.335999 42.672001 47.903999 50.939999 54.647999 62.495998 69.047997 74.928001 78.636002 81.671997 88.008003 93.239998 95.762398 98.798401 104.9676 114.8556 117.8916 124.1928 129.26759 132.9756 136.0116 141.0168 145.42081 148.4568 155.0088 161.2356 166.6848 171.7596 175.46761 177.99001 181.026 184.086 189.17281 194.64481 197.6808 204.0768 209.30881 213.7128 216.74879 219.7368 225.06599 229.326 233.034"
         y="0"
         id="tspan202">Jeg har da tænkt på, om det er noget, jeg har lyst </tspan><tspan
         x="0 3.7428 6.9348001 9.9588003 12.4812 15.5172 21.483601 27.6528 32.056801 35.0928 41.392799 46.467602 50.175598 53.211601 59.091599 65.571602 72.123596 78.675598 83.715599 86.751602 93.087601 98.319603 101.3556 106.8396 114.6876 118.9476 123.9876 127.0236 131.2836 137.6196 145.46761 152.01961 158.3196 163.3248 169.8768 176.17799 181.218 184.254 189.48599 193.194 196.23 201.714 209.562 213.82201 218.862"
         y="15.996"
         id="tspan204">til. For det kunne da være spændende at være </tspan><tspan
         x="0 6.3011999 11.3052 17.857201 20.379601 23.4156 29.716801 34.722 39.125999 42.161999 48.376801 53.416801 57.6768 61.279202 66.284401 76.172401 86.060402 91.0644 94.7976 97.32 100.356 110.7384 115.7424 122.2944 125.3304 131.63161 136.70641 140.4144 143.45039 148.4556 152.8596 155.8956 162.12241 167.66521 171.9252 177.1572 180.19321 185.26801 188.976 192.01199 196.272 199.8624 206.0316 210.63721 214.3452"
         y="31.992001"
         id="tspan206">den, der bestemmer. Men det er også et stort </tspan><tspan
